import React, { Component } from 'react';
import Pusher from 'pusher-js';

class EnterStall extends Component {
  constructor(props) {
    super(props);
    this.handleOccupantsChange = this.handleOccupantsChange.bind(this);
    this.state = {
      // occupants: [],
      max_occupancy: 4, // ADJUST AS NEEDED
    };
  }

  handleOccupantsChange(e) {
    this.props.onVacancyChange(e.target.value);
  }

  updateOccupants(member) {
    this.setState({
      visitors: [...this.state.occupants, member],
    })
  }

  render() {
    const vacant = this.props.vacant;
    return (
      <div id="stall">
        Currently vacant: {vacant}
      </div>
    );
  }

}

export default EnterStall;
